import React, { Component } from "react";
import Navbar from "./components/Navbar";
import Section from "./components/Section";
import dummyText from "./dummyText";
import CarouselBox from "./components/CarouselBox";

class App extends Component {
  render() {
    return (

            <div className="App">

                <div className="bg">
                  <Navbar />

                  <Section  dark={true} id="section1" />
                  <CarouselBox/>
                  <Section title="Section 2" subtitle={dummyText} dark={false} id="section2" />
                  <Section title="Section 3" subtitle={dummyText} dark={true} id="section3" />
                  <Section title="Section 4" subtitle={dummyText} dark={false} id="section4" />
                  <Section title="Section 5" subtitle={dummyText} dark={true} id="section5" />
                </div>
            </div>


        );
      }
    }

export default App;
